$(function () {
	/*-----------------------------------------------
	  Royalslider
	-----------------------------------------------*/
	$(".royalSlider").royalSlider({
		keyboardNavEnabled: true,
		imageScaleMode: "none",
		arrowsNav: false,
		imageScalePadding: 0,
		slidesSpacing: 0,
		minSlideOffset: 0,
		randomizeSlides: false,
		transitionType: "fade",
		controlNavigation: "none",
		loop: true,
		autoHeight: true,
		autoPlay: {
			enabled: true,
			delay: 4000,
			pauseOnHover: false
		}
	});

	/*-----------------------------------------------
		Home Navigation
	-----------------------------------------------*/
	$('body').scrollspy({
		target: '#home-navigation'
	});

	$('#home-navigation').find('a').on('click', function (e) {
		e.preventDefault();
		var $target = $(this.hash);
		$('html, body').stop().animate({
			'scrollTop': $target.offset().top
		}, 900, 'swing');
	});


	function checkOffset() {
		if ($('#home-navigation').offset().top + $('#home-navigation').height() >= $('footer').offset().top - 50)
			$('#home-navigation').css({
				visibility: 'hidden',
				opacity: 0
			});
		if ($(document).scrollTop() + window.innerHeight < $('footer').offset().top)
			$('#home-navigation').css({
				visibility: 'visible',
				opacity: 1
			});
	}

	$(document).scroll(function () {
		checkOffset();
	});

	/*-----------------------------------------------
		Handwriting
	-----------------------------------------------*/
	var element = document.getElementById('kaesepost');
	var test = lottie.loadAnimation({
		container: element,
		renderer: 'svg',
		loop: false,
		autoplay: false,
		path: 'upload/layout/kaesepost.json'
	});

	$(window).on("load", function () {

		inView.threshold(1);
		inView('#kaesepost').on('enter', function () {
			test.play();
		});

		/*-----------------------------------------------
	    Paroller
		-----------------------------------------------*/
		$(".hand").paroller();
	});
});
